import React from 'react';

import { H1, Navbar, NavItems, NavItem, Wrapper } from './components'

import Marvel from './containers/Marvel'


class App extends React.Component {
	constructor(props) {
		super(props);
		this.state = {navbarEnabled: false};
	};

	toggleNavbar() {
		return 'lol';
	}

	render() {
	return(
		<Wrapper>
			<Navbar position='fixed' width='400px' height='100vh' background='black'>
			<button onClick={ () => { toggleNavbar() } }>toggle nav</button>
				<NavItems justify='left'>
				<H1 big borderbottom padding='50px 0px 0px 0px'>THE WATCH ORDER</H1>
					<NavItem><H1>Phase 1</H1></NavItem>
					<NavItem>Iron Man</NavItem>
					<NavItem>Iron Man</NavItem>
					<NavItem>Iron Man</NavItem>
				</NavItems>
			</Navbar>

			<Marvel marginleft='400px' />
		</Wrapper>
	);
	}
}

export default App;
